regex = r"(\d{4})-(\d{2})-(\d{2})"

results = re.findall(regex, text)

birthday = datetime.strptime('07/03/2021', '%d/%m/%Y').date()

dates = []

for date in results:
    dates.append(datetime.strptime('-'.join(date), '%Y-%m-%d').date())

date = min(dates, key=lambda x: abs(x - birthday))

print(date.strftime("%d/%m/%Y"))

